webpackJsonp([0xd17c68dc7ce8],{7448:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.eamonn.com/archives/002024.html" title="Eamonn Fitzgerald\'s Rainy Day: Weeping for Angie">Rainy Day:</a></p>\n<blockquote><p>Most commentary on Germany tends to be grave and devoid of humour, but through the tears <a href="http://www.guardian.co.uk/comment/story/0,3604,1590725,00.html" title="Guardian Unlimited | Guardian daily comment | Chancellor Merkel\'s walking stalemate of a government">(Timothy) Garton Ash</a> does manage to retain his wit. Referring to the country\'s "endless TV discussion shows" he says: "Germans may not like change, but they love talking about it." Dead on... </p></blockquote>\n<p>Or, as my boss Nico says, <a href="http://lumma.de/eintrag.php?id=1771" title="Geniggemeiert [Lummaland - das Weblog]">the Sabine-Christiansenization of politics</a>.</p>',fields:{title:"Tell Her About It",date:"13 Oct 2005",url:"https://papascott.de/2005-10-13-tell-her-about-it/"}}},pathContext:{slug:"/2005-10-13-tell-her-about-it/",prev:{fields:{title:"Looting",date:"13 Oct 2005",slug:"/2005-10-13-looting/"}},next:{fields:{title:"Homework Finished",date:"14 Oct 2005",slug:"/2005-10-14-homework-finished/"}}}}}});
